insert  into `faqs`(`id`,`title`,`content`,`category`,`sort_order`,`deleted_at`,`created_at`,`updated_at`) values 
(1,'{\"en\":\"DIRECT ENROLLER COMMISSION\"}','{\"en\":\"<span style=\\\"font-size: 13px;\\\">By building your business, Elysium rewards you with a Direct<\\/span><div><span style=\\\"font-size: 13px;\\\">Enroller Commission [DEC] based on sales of software packages<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">[EOS, XOOM, SOHO] to new Affiliates and IB\\u2019s.<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">The Affiliate software package [EOS] can be sold to new Affiliates<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">and rewards you with a one time<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">\\u20ac<\\/span>25 commission.<\\/div><div><span style=\\\"font-size: 13px;\\\">The IB software package [EOS, XOOM, SOHO] can be sold to new<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">IB\\u2019s and rewards you with a one time<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">\\u20ac<\\/span>100 commission.<\\/div><div><span style=\\\"font-size: 13px;\\\">There is no limit set for the amount of software packages you<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">can sell to new Affiliates and IB\\u2019s and the amount of Direct<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">Enroller Commissions that can be earned.<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">To earn Direct Enroller Commissions, you must be Active and<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">Paid at the respective Rank.<\\/span><\\/div>\"}',2,NULL,NULL,'2019-05-21 00:50:41','2019-12-12 23:14:13'),
(2,'{\"en\":\"PERFORMANCE FEE COMPENSATION&nbsp; [PFC]\"}','{\"en\":\"<div><span style=\\\"font-size: 13px;\\\">Performance Fee Commission [PFC] is calculated on the portfolio performance, Return On Investment (ROI).<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">As soon as the portfolio generates a positive ROI on the invest- ment of an investment client, the system calculates ROI + 20% and assigns it to the Affiliate- IB enrollment tree, on a 7-Tier structure. This 20% total fee is split up in 7 commission levels<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\"><br><\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">TIER 1: 80% TIER 2: 5% TIER 3: 2,5% TIER 4: 2,5% TIER 5: 2,5% TIER 6: 2,5% TIER 7: 2,5%<\\/span><br><\\/div>\"}',2,NULL,NULL,'2019-05-21 00:51:39','2019-12-12 23:36:38'),
(3,'{\"en\":\"How often i can request payout ?\",\"es\":\"How','{\"en\":\"You may request every friday, and it will be credited before monday\",\"es\":\"You may request every friday, and it will be credited before monday\"}',1,1,NULL,'2019-05-21 00:52:50','2019-05-21 00:52:50'),
(4,'{\"en\":\"Is three any additional charges ?\",\"es\":\"Is','{\"en\":\"It will be charged 1% of total amount you requested\",\"es\":\"It will be charged 1% of total amount you requested\"}',1,2,NULL,'2019-05-21 00:53:54','2019-05-21 00:53:54'),
(5,'{\"en\":\"DYNAMIC COMPRESSION UNILEVEL BONUS (DCU)\"}','{\"en\":\"<div><span style=\\\"font-size: 13px;\\\">As soon as you help your team to expand their business, Elysium rewards you with a Dynamic Compression Unilevel Bonus [DCU] based on sales of software packages [EOS, XOOM, SOHO] to new IB\\u2019s.<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\"><br><\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">Every time a software package [EOS, XOOM, SOHO] sells to IB\\u2019s in your teams, Elysium rewards you with a one time \\u20ac25 com- mission up to 7 levels deep, depending on your qualified rank.<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">DYNAMIC COMPRESSION UNILEVEL BONUS [DCU] IMMEDIATE INCOME<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\"><br><\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">To make sure that the maximum amount of bonuses, 7 x \\u20ac25 will be paid out the system uses a Dynamic Compression Payout Recognition Model, meaning that when one is not qualified to receive a bonus, the next qualified IB in line will receive the bonus.<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">&nbsp;<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">To earn Dynamic Compression Unilevel Bonus at the levels, you must be Active and Paid at the respective Rank.&nbsp;<\\/span><\\/div>\"}',2,NULL,NULL,'2019-12-12 23:40:19','2019-12-12 23:40:19'),
(6,'{\"en\":\"DYNAMIC COMPRESSION UNILEVEL BONUS (DCU)\"}','{\"en\":\"<div><span style=\\\"font-size: 13px;\\\">As soon as you help your team to expand their business, Elysium rewards you with a Dynamic Compression Unilevel Bonus [DCU] based on sales of software packages [EOS, XOOM, SOHO] to new IB\\u2019s.<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\"><br><\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">Every time a software package [EOS, XOOM, SOHO] sells to IB\\u2019s in your teams, Elysium rewards you with a one time \\u20ac25 com- mission up to 7 levels deep, depending on your qualified rank.<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">DYNAMIC COMPRESSION UNILEVEL BONUS [DCU] IMMEDIATE INCOME<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\"><br><\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">To make sure that the maximum amount of bonuses, 7 x \\u20ac25 will be paid out the system uses a Dynamic Compression Payout Recognition Model, meaning that when one is not qualified to receive a bonus, the next qualified IB in line will receive the bonus.<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">&nbsp;<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">To earn Dynamic Compression Unilevel Bonus at the levels, you must be Active and Paid at the respective Rank.&nbsp;<\\/span><\\/div>\"}',2,NULL,'2019-12-12 23:42:02','2019-12-12 23:41:05','2019-12-12 23:42:02'),
(7,'{\"en\":\"TEAM VOLUME COMMISSION (TVC)\"}','{\"en\":\"<div><span style=\\\"font-size: 13px;\\\">As soon as you start to build your network of IB\'s and Affiliates, Elysium will reward you with Team Volume Commissions [TVC]. IB\'s and Affiliates are placed into your dual Team Tree either on the left or right side.<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">Every time an IB or Affiliate in your Team sells a software package [EOS, XOOM, SOHO] or pays the monthly software subscription fee, the system generates Team Volume with CV (Commissionable Volume). As your teams grow, your Team Volume Commis- sions will grow.<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">TEAM VOLUME COMMISSIONS [TVC]<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">RESIDUAL INCOME<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">When one of your Teams (the left or right) reaches 200 CV and the other reaches 200 CV in sales (it doesn\\u2019t matter which one), you earn a \\u20ac20 Team Volume Commission, also called a \\u201ccycle bonus<\\/span>\\u201c. Team Volume Commissions are paid weekly and are recurring-- you continue to earn \\u20ac20 cycle bonus every time your Teams accumulate the 200\\/200 CV.&nbsp;<\\/div>\"}',2,NULL,NULL,'2019-12-12 23:45:58','2019-12-12 23:45:58'),
(8,'{\"en\":\"GENERATIONAL MATCHING BONUS (GMB)\"}','{\"en\":\"<div><span style=\\\"font-size: 13px;\\\">As soon as you advance in rank, Elysium rewards you with a Generational Matching Bonus [GMB] for training and growing your Lines of Sponsorship. The Matching Bonus pays a percentage of Team Volume Commissions [TVC] earned on levels 1 \\u2013 9 of your Lines of Sponsorship, based on your Paid As Rank qualification.<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\"><br><\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">The first rank at which you may earn the Matching Bonus is 1-Star IB. At this rank, you may earn 20% on Team Commissions from the sales in your first level of IB\'s within your Lines of Sponsorship (your Enroller Tree).<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\"><br><\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\">To earn weekly Generation Matching Bonus at the levels indicated in the chart, you must be Active and Paid at the respective Rank.&nbsp;<\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\"><br><\\/span><\\/div><div><span style=\\\"font-size: 13px;\\\"><br><\\/span><\\/div>\"}',2,NULL,NULL,'2019-12-12 23:48:29','2019-12-12 23:48:29'),
(9,'{\"en\":\"DIAMOND BONUS POOL (DBP)\"}','{\"en\":\"<p><span style=\\\"font-size: 13px;\\\">Diamond IB positions may earn shares of the company\\u2019s global sales by qualifying for the Diamond Bonus Pool [DBP]. The Diamond Pool includes 3% of the company\\u2019s global Commission- able Volume (CV) from product sales made each quarter. This pool is divided among qualifying Diamonds according to the shares accumulated during the quarter.<\\/span><\\/p><p><span style=\\\"font-size: 13px;\\\"><br><\\/span><\\/p><p><span style=\\\"font-size: 13px;\\\">The bonus pool is calculated quarterly and the bonus is paid according to the shares IB\'s earned during the bonus period.&nbsp;<\\/span><\\/p><p><span style=\\\"font-size: 13px;\\\"><br><\\/span><\\/p><p><span style=\\\"font-size: 13px;\\\">To participate in the Diamond Bonus Pool, your highest achieved rank, must be Diamond IB on or before the first day of the quarter.&nbsp;<\\/span><\\/p><p><span style=\\\"font-size: 13px;\\\"><br><\\/span><\\/p><p><span style=\\\"font-size: 13px;\\\">Diamonds may accumulate shares as follows;<\\/span><\\/p><p><span style=\\\"font-size: 13px;\\\"><br><\\/span><\\/p><p><span style=\\\"font-size: 13px;\\\">One share is awarded per month in the quarter that IB was paid as a Diamond IB President\'s team.<\\/span><\\/p><p><span style=\\\"font-size: 13px;\\\"><br><\\/span><\\/p><p><span style=\\\"font-size: 13px;\\\">Two shares are awarded per month in the quarter that IB was paid as Diamond IB Chairman&nbsp;team.&nbsp;<\\/span><\\/p>\"}',2,NULL,NULL,'2019-12-12 23:52:28','2019-12-17 01:24:21');
